import React from 'react'
import { Link } from 'react-router-dom'
import styles from './Register.module.css'
import registerService from './registerService'

function Register() {

	const handleSubmit = (e) => {
		e.preventDefault();

	}

	return (
		<div className={styles.reg_container}>
			<p>Registrarse</p>
			<div className={styles.link}>
				<p>¿Ya tenés una cuenta?</p>
				<Link to="/">Ingresa aquí</Link>
			</div>
			<form className={styles.form} onSubmit={handleSubmit} action="http://localhost:1234/register" method='POST'>
				<input className="form-control rounded-5" type="text" name="name" placeholder="name" aria-label="default input example"></input>
				<input className="form-control rounded-5" type="text" name="lastname" placeholder="lastname" aria-label="default input example"></input>
				<input className="form-control rounded-5" type="email" name="email" placeholder="email" aria-label="default input example"></input>
				<input className="form-control rounded-5" type="password" name="password" placeholder="password" aria-label="default input example"></input>
				<input className="form-control rounded-5" type="password" name="repeatPassword" placeholder="repeat password" aria-label="default input example"></input>
				<div className="d-grid gap-2">
					<button className="btn btn-primary rounded-5" type="submit">Registrarse</button>
				</div>
			</form>
		</div>
	);
}

export default Register;
